import React from 'react';
import '../home/home.css';
import imagenFondo from '../../img/imagenfondo1.jpg';

function Home() {

return (
    <div className="text"> 
      <h1 className="title">Universe of Dogs</h1>
      <img src={imagenFondo} alt="unirverse of Dog" className='imagefondo' />  
    </div>
  );
}

export default Home;
